import { Controller } from "@hotwired/stimulus"

// Connects to data-controller="confirm"
export default class extends Controller {
  static targets = ["modal", "message"]
  static values = {
    message: String
  }

  show(event) {
    // Prevent the default action
    event.preventDefault()
    event.stopPropagation()

    // Store the triggering element
    this.triggeringElement = event.currentTarget

    // Get confirmation message from data attribute or value
    const message = this.triggeringElement.dataset.confirmMessage || this.messageValue

    if (message) {
      this.messageTarget.textContent = message
    }

    // Show the modal
    this.modalTarget.classList.remove("hidden")
    this.modalTarget.classList.add("flex")
  }

  confirm(event) {
    event.preventDefault()

    // Hide the modal
    this.modalTarget.classList.add("hidden")
    this.modalTarget.classList.remove("flex")

    // Trigger the original action
    if (this.triggeringElement) {
      // For Turbo links/forms, we need to trigger the actual navigation/submission
      if (this.triggeringElement.hasAttribute("data-turbo-method")) {
        // It's a link with a method (DELETE, etc.)
        const method = this.triggeringElement.dataset.turboMethod
        const href = this.triggeringElement.href

        // Create a form and submit it
        const form = document.createElement("form")
        form.method = "post"
        form.action = href

        const csrfToken = document.querySelector('meta[name="csrf-token"]').content
        const csrfInput = document.createElement("input")
        csrfInput.type = "hidden"
        csrfInput.name = "authenticity_token"
        csrfInput.value = csrfToken
        form.appendChild(csrfInput)

        const methodInput = document.createElement("input")
        methodInput.type = "hidden"
        methodInput.name = "_method"
        methodInput.value = method
        form.appendChild(methodInput)

        document.body.appendChild(form)
        form.submit()
      } else if (this.triggeringElement.tagName === "BUTTON" && this.triggeringElement.form) {
        // It's a button within a form
        this.triggeringElement.form.submit()
      } else {
        // Regular link - just click it
        this.triggeringElement.click()
      }
    }
  }

  cancel(event) {
    event.preventDefault()

    // Hide the modal
    this.modalTarget.classList.add("hidden")
    this.modalTarget.classList.remove("flex")

    // Clear the triggering element
    this.triggeringElement = null
  }

  // Close modal when clicking backdrop
  closeBackdrop(event) {
    if (event.target === this.modalTarget) {
      this.cancel(event)
    }
  }
}

